import RankRecipe from "./Rank"

import Footer from "./Footer"

function RankScreen () {
  return (
    <>
        <NavbarComponent className="navbar"/>
        <div className="container mb-5">
        
        </div>
        <RankRecipe />
        <Footer/>
    </>
  )
}

export default RankScreen;
